import styled from 'styled-components'

const Outer = styled.div`
    padding-top: 10px;

    h1{
        border: 1px solid black;
    }

    img {
        border-radius: 50%;
        border: 1px solid black;
    }

    ul {
        text-align: center;
        border: 1px solid black;
    }

    li {
        display: inline;


    }

    i {
        font-size: 30px;
    }
`

export default Outer
